import styled from 'styled-components';

export const LinkingWrapper = styled.div`
.selected {
    :after {
        content: '';
        display: block;
        position: absolute;
        bottom: -5px;
        left: 50%;
        height: 16px;
        border-left: 1px solid black;
    }


.nav-list {
    display: flex;
    justify-content: center;
    list-style: none;
    margin-left:450px;

}
.nav-list li {
    margin: 0 30px;
}
.nav-list a {
    text-decoration: none;
    color:black;
}

.header{
    display: flex;
    align-items: center;

}
.header-logo{
    padding-left: 30px;
    width: 60px;    
    height: 60px;

}

.header-logo img{
    display:flex;
    width: 100%;

}

.Home-button{
    background-color: darkgray;
    border-radius: 13px;
    height: 28px;
}





}

`
